import React, {useState} from "react";
import events from './eventsData'
import Event from './Event'

const Tbody = (searchValue, searchKey) => {

    const filteredEvents = events.filter((e) =>
        e[searchKey].toLowerCase().includes(searchValue.toLowerCase())
    );

    return (
        <tbody>
            {filteredEvents.map((e) => (
                <Event
                    key={e.id}
                    id={e.id}
                    title={e.name}
                    place={e.place}
                    deadline={e.deadline}
                    stt={e.status}
                    budget={e.budget}
                />
            ))}
        </tbody>
    );
};

export default Tbody;
